import * as React from 'react';
import Link from '@mui/material/Link';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Title from './Title';
import { DataFetching } from './DataFetching'

// Generate Stations Data
function createData() {
  fid, id, name, address, x, y, total_journeys_starting, total_journeys_ending
  return { fid, id, name, address, x, y, total_journeys_starting, total_journeys_ending };
}



function getDataStations() {

    const url = "/api/stations/";

    let method = "GET";

    let res 

    const fetchData = async (url, method) => {
        try {
            const response = await fetch(url, {
                method: method,
                mode: 'no-cors'
            })

            const json = await response.json();

            console.log(json);
            setAdvice(json);
        } catch (error) {
            console.log("error", error);
        }
    }

    fetchData(url, method);
};
















const rows = [
  createData()


];

function preventDefault(event) {
  event.preventDefault();
}

export default function Stations(props) {

  return (
    <React.Fragment>
      <Title />
      <Table size="medium">
        <TableHead>
          <TableRow>
            <TableCell>Finnish id</TableCell>
            <TableCell>Name</TableCell>
            <TableCell>Address</TableCell>
            <TableCell>Departure</TableCell>
            <TableCell>Arrival</TableCell>
            <TableCell>Total Journeys Starting</TableCell>
            <TableCell align="right">Total Journeys Ending</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {props.rows.map((row) => (
            <TableRow key={row.id}>
              <TableCell>{row.fid}</TableCell>
              <TableCell>{row.name}</TableCell>
              <TableCell>{row.address}</TableCell>
              <TableCell>{row.x}</TableCell>
              <TableCell>{row.y}</TableCell>
              <TableCell>{row.total_journeys_starting}</TableCell>
              <TableCell align="right">{`${total_journeys_ending}`}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
      <Link color="primary" href="#" onClick={preventDefault} sx={{ mt: 3 }}>
        See more stations
      </Link>
    </React.Fragment>
  );
}
